import { Grid } from "hero-design"
import { Image } from 'react-bootstrap';
import { Link, NavLink, useHistory } from "react-router-dom";

const styles ={
    navLink:{
        paddingLeft:13,
        textDecoration:'none'     
    }
}

export default function Header() {
    const history = useHistory()

    return (
        <Grid.Row>
            <Grid.Col>
                <Image
                    src={'/augustus.png'}
                    roundedCircle
                    style={{
                        width: '100px',
                        height: '',
                        paddingLeft: '20px',
                        cursor: 'pointer'
                    }}
                    onClick={(e: any) => {
                        history.push('/dam')
                    }}
                ></Image>
            </Grid.Col>
            <Grid.Col span={[8, 8, 8, 8, 8]} offset={[16, 16, 16, 16, 16]}>
                <NavLink
                    to="/marketplace"
                    activeStyle={{
                        fontWeight: "bold",
                        color: "red"
                    }}
                    style={styles.navLink}
                >
                    Marketplace
                </NavLink>
                <NavLink
                    to="/carts"
                    activeStyle={{
                        fontWeight: "bold",
                        color: "red"
                    }}
                    style={styles.navLink}
                >
                    Orders
                </NavLink>
            </Grid.Col>
        </Grid.Row>
    )
}
